        public string Function1(string s, List<List<string>> knowledge)
        {
            int l = 0, r = 0;
            var keys = new List<string>();
            var values = new List<string>();
            l = s.IndexOf('(');
            r = s.IndexOf(')');
            if (l == -1) return s;
            foreach (var k in knowledge)
            {
                keys.Add(k[0]);
                values.Add(k[1]);
            }
            var key = s.Substring(l + 1, r - l - 1);
            var sR = s.Substring(r + 1);
            var sL = s.Substring(0, l);
            var index = keys.FindIndex(p => p == key);
            if (index != -1)
            {
                s = sL + values[index] + sR;
            }
            else
            {
                s = sL + "?" + sR;
            }

            return Function1(s, knowledge);
        }

        public string Function2(string s, List<List<string>> knowledge)
        {
            IDictionary<string, string> dict = new Dictionary<string, string>();
            foreach (IList<string> kd in knowledge)
            {
                dict.Add(kd[0], kd[1]);
            }
            bool add = false;
            StringBuilder key = new StringBuilder();
            StringBuilder res = new StringBuilder();
            foreach (var c in s)
            {
                if (c == '(')
                {
                    add = true;
                }
                else if (c == ')')
                {
                    if (dict.ContainsKey(key.ToString()))
                    {
                        res.Append(key.ToString());
                    }
                    else
                    {
                        res.Append('?');
                    }
                    add = false;
                    key.Length = 0;
                }
                else
                {
                    if (add)
                    {
                        key.Append(c);
                    }
                    else
                    {
                        res.Append(c);
                    }
                }
            }
            return res.ToString();
        }
